import { PureComponent } from "react/cjs/react.production.min";
import Phase from "./Phase/Phase";
import style from "./StatusBar.module.css"

class StatusBar extends PureComponent {
    render(){
        return(
            <div className={style.Container}>
                <Phase num={2} fillColor='#A82223' active  finish name="shipping" />
                <Phase num={3} fillColor='#A82223' active  finish name="checkout" />
                <Phase num={4} fillColor='#A82223' active  finish last name="done" />
            </div>
        )
    }
}

export default StatusBar
